import { Col, Container, Row } from "react-bootstrap";

import Photo1 from '../News/NewsImage/photo1.jpeg';

function News(){
    return(
        <Container fluid>
            <Row>
                <Col lg = "8" md = "8" sm = "12">
                    <img src = {Photo1} className = "w-100"/>
                </Col>
                <Col lg = "4" md = "4" sm = "12">
                    <Row>
                        <Col lg = "12" md = "12" sm = "12"></Col>
                        <Col lg = "12" md = "12" sm = "12"></Col>
                    </Row>
                </Col>
            </Row>
        </Container>
    )
}

export default News
